import { FaTachometerAlt, FaEye, FaFileAlt, FaUserPlus, FaCogs, FaLocationArrow, FaCheck, FaReply } from 'react-icons/fa';

const List = {
  person: [
    { label: 'Person dashboard', path: '/pers', icon: <FaTachometerAlt /> },
    { label: 'View event', path: '/event', icon: <FaEye /> },
    { label: 'View respond', path: '/response', icon: <FaReply /> },
    { label: 'Post event', path: '/post', icon: <FaFileAlt /> }
  ],

  admin: [
    { label: 'Admin Dashboard', path: '/admin', icon: <FaTachometerAlt /> },
    { label: 'Add user', path: '/add', icon: <FaUserPlus /> },
    { label: 'Manage event', path: '/event-manager', icon: <FaFileAlt /> },
    { label: 'Generate report', path: '/admin', icon: <FaFileAlt /> },
    { label: 'View event', path: '/event', icon: <FaEye /> },
    { label: 'Setting', path: '/setting', icon: <FaCogs /> }
  ],

  response_Officer: [
    { label: 'Officer Dashboard', path: 'officer', icon: <FaTachometerAlt /> },
    { label: 'View event', path: 'view', icon: <FaEye /> },
    { label: 'View location', path: 'event', icon: <FaLocationArrow /> },
    { label: 'Sent response', path: 'sendresp', icon: <FaReply /> }
  ],

  sheha: [
    { label: 'Sheha Dashboard', path: 'var', icon: <FaTachometerAlt /> },
    { label: 'View event', path: 'event', icon: <FaEye /> },
    { label: 'Verify event', path: 'var', icon: <FaCheck /> }
  ]
};

export default List;
